// import '../styles.css'

const Index = () => {
    return (
        <div class="container">
            <h1>VKYD</h1>
            <h2>Pseduo-CDN built on Next.JS with Vercel</h2>
            <style jsx>{`
                div {
                    width: 90%;
                    display: block;
                    margin: 0 auto;
                    text-align: center
                }

                @font-face {
                    font-family: Plateia;
                    src: url(fonts/Plateia-Bold.ttf);
                }
                @font-face {
                    font-family: Poppins;
                    src: url(fonts/Poppins-Regular.ttf);
                }

                h1 {
                    font-size: 2rem;
                    font-family: Plateia;
                }
                h2 {
                    font-family: Poppins;
                }

            `}</style>
        </div>
    )
};

export default Index;
